  `chart_type` varchar(15) DEFAULT NULL,
  `db_details_id` int DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `defined_query` text,
  `enable_drilldown` varchar(3) DEFAULT NULL,
  `auto_update_interval` int DEFAULT NULL,
  `background_colour` varchar(10) DEFAULT NULL,
  `chart_react_colour` varchar(50) DEFAULT NULL,
  `time_period` varchar(30) DEFAULT NULL,
  `theme` varchar(255) DEFAULT NULL,
  `report_sub_title` varchar(255) DEFAULT NULL,
  `dashboardMapId` int DEFAULT NULL,
  `created_user` varchar(45) DEFAULT NULL,
  `display_order` int DEFAULT NULL,
  `start_date` varchar(25) DEFAULT NULL,
  `end_date` varchar(25) DEFAULT NULL,
  `upload_logo` blob,
  `show_in_dashboard` varchar(25) DEFAULT NULL,
  `font_size_title` varchar(15) DEFAULT NULL,
  `font_size_value` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`report_id`),
  UNIQUE KEY `report_template_name_UNIQUE` (`report_template_name`),
  KEY `customer_id` (`customer_id`),
  CONSTRAINT `report_template_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=233 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
